import React from 'react';
import './buttonsub.css';
const Buttonsub = ({label, type = 'submit'}) => {
  return (
    <div className='button_box'>
      <button type={type} className='submit_button'>
        {label}
      </button>
    </div>
  )
}

export default Buttonsub
